import { BrowserRouter, Routes, Route } from "react-router-dom";
import Search from "./pages/Search";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/Search" element={<Search />}></Route>
        </Routes>
    </BrowserRouter>
  );
}

export default App;
